import React, { Component } from 'react';
export default class Header extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <React.Fragment>
      <header id="home">
        <nav id="nav-wrap">
          <a className="mobile-btn" href="#nav-wrap" title="Show navigation">Show navigation</a>
          <a className="mobile-btn" href="#" title="Hide navigation">Hide navigation</a>
          <ul id="nav" className="nav">
            <li className="current"><a className="smoothscroll" href="#home">Home</a></li>
            <li><a className="smoothscroll" href="#about">About</a></li>
            <li><a className="smoothscroll" href="#resume">Resume</a></li>
            <li><a className="smoothscroll" href="#contact">Contact</a></li>
          </ul> {/* end #nav */}
        </nav> {/* end #nav-wrap */}
        <div className="row banner">
          <div className="banner-text">
            <h1 className="responsive-headline">Maithri Chullikana House.</h1>
            <h3>{resumeData.role}<a style={{color: '#FF8300'}} href="https://www.csueastbay.edu/" target="_blank">CSUEB</a>.  <a style={{color: '#FF8300'}} className="smoothscroll" href="#about" />
              Scroll down to know more<a style={{color: '#FF8300'}} className="smoothscroll" href="#about">about me</a>.</h3>
            <ul className="social">
              <li><a href="https://www.linkedin.com/in/maithri-ch/" target="_blank"><i className="fa fa-linkedin" /></a></li>
              <li><a href="https://github.com/Maithri-CH" target="_blank"><i className="fa fa-github" /></a></li>
              <li><a href="https://twitter.com/maithri8" target="_blank"><i className="fa fa-twitter" /></a></li>
              <li><a href="https://www.instagram.com/my3_ch/" target="_blank"><i className="fa fa-instagram" /></a></li>
              <li><a href="https://www.facebook.com/my3.maithri" target="_blank"><i className="fa fa-facebook" /></a></li>
            </ul>
          </div>
        </div>
        <p className="scrolldown">
          <a className="smoothscroll" href="#about"><i className="icon-down-circle" /></a>
        </p>
      </header>
      </React.Fragment>
    );
  }
};
